INSERT INTO `questions` (`id`,`question_text`,`question_type_id`,`priority`,`quiz_id`,`point`,`added_date`,`parent_id`,`question_total`,`check_total`,`header_text`,`footer_text`,`question_text_eng`,`help_image`) VALUES 
 (1,'<p>\r\n	A boat running upstream takes 8 hours 48 minutes to cover a certain distance, while it takes 4 hours to cover the same distance running downstream. What is the ratio between the speed of the boat and speed of the water current?</p>',1,1,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (2,'<p>\r\n	A boat covers a certain distance downstream in 1 hour, while it comes back in 3/2 hours. If the speed of the stream be 3 km/hr, what is the speed of the boat in still water?</p>',1,2,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (3,'<p>\r\n	A man can row at 5 km/hr in still water. If the velocity of current is 1 km/hr and it takes him 1 hour to row to a place and come back, how far is the place?</p>',1,3,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (4,'<p>\r\n	Two pipes &quot;A&quot; and &quot;B&quot; can fill a cistern in 37 (1/2) minutes and 45 minutes respectively. Both pipes are opened. The cistern will be filled in just half an hour, if the &quot;B&quot; is turned off after _____ mins?</p>',1,4,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (5,'<p>\r\n	A tank is filled by three pipes with uniform flow. The first two pipes operating simultaneously fill the tank in the same time during which the tank is filled by the third pipe alone. The second pipe fills the tank 5 hours faster than the first pipe and 4 hours slower than the third pipe. The time required by the first pipe is _____hrs?</p>',1,5,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (6,'Find the smallest three number, which is a multiple of 7?',1,6,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (7,'Find the greatest 6-digit number, which is a multiple of 12?',1,7,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (8,'Which of the following number should be added to 28614 in order to obtain a multiple of 87?',1,8,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (9,'The seven digit number 43567X is divisible by 3, where &lsquo;X&rsquo; is a single digit whole number. Find &lsquo;X&rsquo;?',1,9,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (10,'Find the sum of all three digit numbers, which are multiples of 6?',1,10,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (11,'The average age of a group of persons going for tour to Shimla is 22 years. 25 new persons with an average age of 10 years join the group and their average age becomes 12 years. The number of persons initially going for tour is________?',1,11,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (12,'The average salary of 65 workers is Rs 5,680 out of which average salary of 31 workers is Rs 2,356 and that of 23 workers is Rs 4,589. What is the average salary of remaining workers?',1,12,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (13,'Out of three numbers, the first is twice the second and is half of the third. If the average of the three numbers is 56, then difference of the first and third number is_________?',1,13,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (14,'There are 14 people in a family and the average age of all the family members is 30 years. A new baby is born in a family. After 4 years, what will be the average age of the all family members?',1,14,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (15,'There are 25 students in a class and the average of their ages is 15 years. The average age of the first 12 students is 14 and the average age of the last 12 students is 16. If the age of Amrutha is 5 years more than the age of 13th student, find the age of Amrutha?',1,15,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (16,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A farmer has some cows and some chickens for a total of 30 animals and the animals have 74 legs in all. How many chickens does the farmer have?</div>\n',1,16,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (17,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">\r\n	A Scientist is experimenting with bacteria that are one micron in diameter and that reproduce by dividing every minute into two bacteria. At 12:00 PM, she puts a single organism in a container. At precisely 1:00 PM, the container is full. At what time was the container half full?</div>',1,17,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
 (18,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If Rahul finds that he is 12th from the right in a line of boys and 4th from the left, how many boys should be added to the line such that there are 28 boys in the line?</div>\n',1,18,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
