 (22,'<div style=\"font-weight:bold;\">P, Q, R, S, T, V and W. are seven friends. Each of them likes a particular fruit, viz. Apple, Banana, Pear, Guava, Orange, Mango and Watermelon and each of them has a favourite city, viz. Mumbai, Pune, Delhi, Kolkata, Chennai, Hyderabad and Cochin. The choices of fruit and favourite city of the seven friends aren\'t necessarily in the same order.</div>\n<div style=\"font-weight:bold;\">Q likes Mango and his favourite city is Chennai. The one whose favourite city is Pune likes Watermelon. T\'s favourite city is Kolkata. R likes Guava and his favourite is not Mumbai. W\'s favourite city is Cochin and he does not like either Banana or Pear. The favourite city of the one who likes Orange is Hyderabad. T does not like Pear. P\'s favourite city is neither Pune nor Hyderabad. S does not like Watermelon.</div>\n<div style=\"font-weight:bold;\">Who likes Apple?</div>\n',1,22,1,'1','2023-08-17 13:26:21',0,NULL,NULL,'','',NULL,NULL),
