 the struggle for freedom came to an end and the major non- formal agency of political education disappeared. The press played a major role by providing some political education. But it did not utilize the opportunity to the full and the strangle hold of vested interests continued to dominate it. The same can be said of political parties as well as of other institutions and agencies outside the school system which can be expected to provide political education. After analyzing all these things , it appears that we have made no progress in genuine political education in the post-education period and have even slided back in some respects. For instance, the education system has become even more elite-oriented. Patriotism has become the first casualty. The father of the nation gave us the courage to oppose government when it was wrong, in a disciplined fashion and on basic principles. Today, we have even lost the courage to fight on basic issues in a disciplined manner because agitational and anarchic politics for individual, group or party aggrandizement has become common. In the recent times the education system continues to support domination of the privileged groups and domestication of the under- privileged ones. The situation will not change unless we take vigorous steps to provide genuine political education on an adequate scale. This is one of the major educational reforms we need, and if it is not carried out, mere linear expansion of the existing system of formal education will only support the status quo and <span style=\"font-weight:bold;\">hamper</span> radical social transformation.</div><div style=\"margin-bottom:7px;font-weight:normal;\">Which is the most opposite in meaning to the word &lsquo;hamper&rsquo; as used in the passage?</div>',1,50,1,'1','2023-08-17 13:26:22',0,NULL,NULL,'','',NULL,NULL),
